import React from "react";
import './NavBar.css';
import { NavLink } from 'react-router-dom';

function NavBar() {
  return (
	<>
		<Nav>
			<NavLink to="/">
				<div className="logo">Haytham</div>
				<div className="logo-sub">Dev</div>
			</NavLink>
		</Nav>
	</>
  )
}

export default NavBar

function NavBarr() {
  return (
    <Navbar>
      <Container className="navbarr">
        <Navbar.Brand className="nav-logo" href="/home">
			<div className="logo">Haytham</div>
			<div className="logo-sub">Dev</div>
		</Navbar.Brand>
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
			<Nav.Item className="nav-items">
				<Nav.Link className="about" href="/about">About</Nav.Link>
				<Nav.Link className="projects" href="/projects">Projects</Nav.Link>
				<Nav.Link className="skills" href="/skills">Skills</Nav.Link>
				<div className="nav-btn">
					<button className="contact-btn" href="/contact">Contact</button>
				</div>
			</Nav.Item>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}
